webpackJsonp([0x60aaa31c0ad8],{2122:function(e,n){e.exports={pathContext:{docHtml:"<h1>buffer-equal-constant-time</h1>\n<p>Constant-time <code>Buffer</code> comparison for node.js.  Should work with browserify too.</p>\n<p><a href=\"https://travis-ci.org/goinstant/buffer-equal-constant-time\"><img src=\"https://travis-ci.org/goinstant/buffer-equal-constant-time.png?branch=master\" alt=\"Build Status\"></a></p>\n<pre><code class=\"language-sh\">  npm install buffer-equal-constant-time\n</code></pre>\n<h1>Usage</h1>\n<pre><code class=\"language-js\">  var bufferEq = require('buffer-equal-constant-time');\n\n  var a = new Buffer('asdf');\n  var b = new Buffer('asdf');\n  if (bufferEq(a,b)) {\n    // the same!\n  } else {\n    // different in at least one byte!\n  }\n</code></pre>\n<p>If you'd like to install an <code>.equal()</code> method onto the node.js <code>Buffer</code> and\n<code>SlowBuffer</code> prototypes:</p>\n<pre><code class=\"language-js\">  require('buffer-equal-constant-time').install();\n\n  var a = new Buffer('asdf');\n  var b = new Buffer('asdf');\n  if (a.equal(b)) {\n    // the same!\n  } else {\n    // different in at least one byte!\n  }\n</code></pre>\n<p>To get rid of the installed <code>.equal()</code> method, call <code>.restore()</code>:</p>\n<pre><code class=\"language-js\">  require('buffer-equal-constant-time').restore();\n</code></pre>\n<h1>Legal</h1>\n<p>Â© 2013 GoInstant Inc., a salesforce.com company</p>\n<p>Licensed under the BSD 3-clause license.</p>",docPath:"argo-ci/node_modules/buffer-equal-constant-time/readme",proj:"argo-ci"}}}});
